export async function ConnectServer() {
    let allUsers = await fetch("ConnectFrontend").then(response => response.json()).then(response => allUsers = response)
    return (
        <div className="allUsers">
            {
                allUsers.map(elenent => <p>{elenent.firstname}</p>)
            }
        </div>
    );
}
